import React from "react";
import { connect } from "react-redux";
import PlayerCard from "./PlayerCard";
import { btnPlay } from "../actions";

const PlayerCardList = ({ game, btnPlay }) => {
  const playerName = [game[0].player, game[1].player];
  const playerList = playerName.map((cur, index) => (
    <PlayerCard key={cur} name={cur} points={game[index]} dispatch={btnPlay} />
  ));
  return <div>{playerList}</div>;
};

const mapStateToProps = state => {
  return { game: state.game };
};
const mapDispatchToProps = () => {
  return { btnPlay };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(PlayerCardList);
